If you want to add the theme you want, follow the below instruction. Add the theme plugin in the plug.lua. Search the pattern "/neovim color theme" and add you plugin into the curly brackets: -- neovim color theme
use { 'Avimitin/neovim-deus', 'Shatur/neovim-ayu', 'YOUR THEME',
} Add the configuration for this theme in the colors.lua Assuming that the name of your theme call "nord". local theme = "nord" local function nord_setup() -- Put your configuration here -- If you don't have configuration for the theme, -- leave it blank here.
end local theme_opt = { ["nord"] = nord_setup,
}
